import react from "react";
import reactDom from "react-dom";
import "./index.css";

const name = 'ola lucas'

const App = () => {

    return (
        <div> 
            {name} 
        </div>
    )
}

const rootElement = document.getElementById("root")
ReactDOM.render(<App />, rootElement)
